import App from "./App";
import "./index.css";

import {AppProvider} from "./productcontext";
import {FilterContextProvider} from "./context/filter_product";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
<AppProvider>
  <FilterContextProvider>
    <CartProvider>
    <App />

    </CartProvider>


  </FilterContextProvider>
</AppProvider>




);
